"use strict";window.addEventListener("DOMContentLoaded",(function(){document.querySelectorAll(".example-card__preview").forEach(t=>{const e=.004*t.naturalHeight,n=5e-4*t.naturalHeight;t.addEventListener("mouseenter",(function(){this.style.cssText=`\n        object-position: 0 100%;\n        transition: object-position ${e}s 0.5s;`})),t.addEventListener("mouseleave",(function(){this.style.cssText=`transition: object-position ${n}s 0.5s;`}))})}));